webpackJsonp([41887442688414],{8799:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Beyond T9",date:"09 Jul 2003",slug:"/2003-07-09-beyond-t9/",tags:"Y2003"},html:'<p><a title="Touch typing on a cell phone? " href="http://www.russellbeattie.com/notebook/20030709.html#142251">Russell Beattie: Beyond T9</a></p>'},next:{fields:{title:"Waiting in the Shower",date:"08 Jul 2003",slug:"/2003-07-08-waiting-in-the-shower/"}},previous:{fields:{title:"Washington Times: Crash caused Lynch's 'horrific injuries'",date:"09 Jul 2003",slug:"/2003-07-09-washington-times-crash-caused-lynchs-horrific-injuries/"}}},{node:{fields:{title:"Waiting in the Shower",date:"08 Jul 2003",slug:"/2003-07-08-waiting-in-the-shower/",tags:"Y2003"},html:'<p>A poster advertising <a href="http://www.axe.de/">\'anti-hangover\' shower gel</a> is gracing the city this week. That alone is weird enough to warrant a post, but even stranger is the tagline (with apologies to <a title="Code The Web Socket" href="http://ahawkins.org/weblog.php">Alwin</a>): Need help in the morning? The nurse waits in your shower! </p>\n<p><img alt="axe.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2003/07/img367.jpg" width="193" height="289" border="0" /></p>\n<p>Somehow, this makes me think of Psycho....</p>'},next:{fields:{title:"Stupid White Men and Women",date:"08 Jul 2003",slug:"/2003-07-08-stupid-white-men-and-women/"}},previous:{fields:{title:"Beyond T9",date:"09 Jul 2003",slug:"/2003-07-09-beyond-t9/"}}},{node:{fields:{title:"Stupid White Men and Women",date:"08 Jul 2003",slug:"/2003-07-08-stupid-white-men-and-women/",tags:"Y2003"},html:'<p>Interesting that the current top two entries on the <a title="Kultur - SPIEGEL ONLINE" href="http://www.spiegel.de/kultur/charts/0,1518,sachbuch,00.html">Spiegel non-fiction bestseller list</a> are both American,  namely Michael Moore "Stupid White Men" and Hillary Clinton "Living History" (and number 7 is Emmanuel Todd "World Power USA: An Obituary", a book I\'m not familiar with but the title seems to say it all).  My conclusion: Germans are very interested in reading about the United States, but only to have their prejudices confirmed.</p>'},next:{fields:{title:"One Hand Clapping: My Beta TypePad Blog",date:"08 Jul 2003",slug:"/2003-07-08-one-hand-clapping-my-beta-typepad-blog/"}},previous:{fields:{title:"Waiting in the Shower",date:"08 Jul 2003",slug:"/2003-07-08-waiting-in-the-shower/"}}}],pathPrefix:"",first:!1,last:!1,index:683,pageCount:1101}}}});
